import React from 'react'

export default function VacationImageShow({vimagesdelete,index,imageURL}) {
  return (
    <div key={index} className="col-sm-2">
        <img src={imageURL} className="img-fluid mb-2" alt="black sample" style={{height:'200px', marginTop:'5px'}}/>
        <div className="row">
            <div className="col-sm-6">{index+1}</div>
            <div className="col-sm-6">
                <button 
                    style={{position:'absolute',bottom:0, right:0,cursor:'pointer',border:'none',color:'white',backgroundColor:'lightcoral'}}
                    onClick={()=>vimagesdelete(index)}
                >Delete
                </button>
            </div>
        </div>
    </div> 
  )
}
